import Logo from '../svgs/lofisoul.svg';
import styled from 'styled-components';


const StyledLogo = styled.h1`
    margin:0;
    svg {
        width:100px;
        height:auto;
    }
`

const Header = () => (
    <header><StyledLogo><Logo /></StyledLogo></header>
)

export default Header;
